import React, { Component } from 'react'
import {Massege, Message} from "semantic-ui-react";
import "semantic-ui-css"
class Clearing extends Component {
  render() {
    return (
     <div>
        <Message>
          <Message.Header>
            Clearing
          </Message.Header>
          The payment was succesful
        </Message>
     </div>
        
    )
  }
}

export default Clearing
